import React, { useState, useCallback } from "react";
import CompanyProspectList from "./companyprospect.jsx";

export default function App() {
  const [companyName, setCompanyName] = useState("");
  const [postalCode, setPostalCode] = useState("");
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // üÜï Mapping intelligent : normalise les cl√©s backend ‚Üí frontend
  const mapCompanyData = (rawData) => {
    if (!Array.isArray(rawData)) return [];
    return rawData.map((ent) => ({
      nom: ent.nom || ent.name || ent.denomination || ent.company_name || "",
      secteur: ent.secteur || ent.sector || ent.activite || ent.industry || ent.activity || "",
      resume: ent.resume || ent.summary || ent.description || ent.abstract || "",
      adresse: ent.adresse || ent.address || ent.location || "",
      site_web: ent.site_web || ent.website || ent.site || ent.url || "",
      contacts: (ent.contacts || ent.contact || ent.contacts_list || []).map((c) => ({
        poste: c.poste || c.position || c.title || c.role || "",
        nom: c.nom || c.name || c.full_name || "",
        email: c.email || c.mail || "",
        telephone: c.telephone || c.phone || c.tel || "",
        linkedin: c.linkedin || c.linked_in || c.profile || "",
      })).filter((c) => c.nom), // Filtre contacts vides
    }));
  };

  async function handleSearch(e) {
    if (e) e.preventDefault(); // Pour Enter
    if (!companyName.trim() || !postalCode.trim()) {
      alert("Veuillez entrer le nom et le code postal de l'entreprise.");
      return;
    }

    setLoading(true);
    setError(null);

    try {
      const response = await fetch("http://localhost:5000/prospect", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ companyName: companyName.trim(), location: postalCode.trim() }),
      });

      if (!response.ok) throw new Error(`Erreur HTTP: ${response.status}`);

      const json = await response.json();
      console.log("üì¶ Donn√©es RAW backend :", json.data);

      const mappedData = mapCompanyData(json.data);
      console.log("üîÑ Donn√©es MAPP√âES (pr√™tes) :", mappedData);
      console.log("üìä Exemple 1er prospect :", mappedData[0] || "Aucun");

      setData(mappedData);
    } catch (err) {
      console.error("‚ùå Erreur fetch :", err);
      setError(`Impossible de r√©cup√©rer les donn√©es : ${err.message}. V√©rifiez le backend (port 5000).`);
    } finally {
      setLoading(false);
    }
  }

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-6xl mx-auto p-4">
        <h1 className="text-3xl font-bold mb-6 text-gray-800">üîç Prospection Entreprises</h1>

        <form onSubmit={handleSearch} className="flex flex-col sm:flex-row gap-3 mb-6">
          <input
            value={companyName}
            onChange={(e) => setCompanyName(e.target.value)}
            placeholder="Nom de l'entreprise (ex: 'ACME Corp')"
            className="flex-1 p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-indigo-500 focus:border-indigo-500"
            disabled={loading}
          />
          <input
            value={postalCode}
            onChange={(e) => setPostalCode(e.target.value)}
            placeholder="Code postal (ex: 75001)"
            className="w-32 p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-indigo-500 focus:border-indigo-500"
            disabled={loading}
          />
          <button
            type="submit"
            disabled={loading}
            className="px-6 py-3 bg-indigo-600 text-white font-medium rounded-lg hover:bg-indigo-700 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
          >
            {loading ? "üîÑ Recherche..." : "üöÄ Rechercher"}
          </button>
        </form>

        {error && (
          <div className="p-4 mb-6 bg-red-100 border border-red-400 text-red-700 rounded-lg">
            {error}
          </div>
        )}

        {loading && (
          <div className="text-center py-12">
            <div className="inline-block animate-spin rounded-full h-8 w-8 border-b-2 border-indigo-600"></div>
            <p className="mt-2 text-gray-600">Recherche en cours... (scraping peut prendre 10-30s)</p>
          </div>
        )}

        {data.length > 0 && (
          <>
            <div className="mb-4 text-center">
              <p className="text-lg font-semibold text-indigo-600">
                ‚úÖ {data.length} entreprise(s) trouv√©e(s) !
              </p>
            </div>
            <CompanyProspectList data={data} />
          </>
        )}
      </div>
    </div>
  );
}
